import {React, Component } from "react";

class ClassBasics extends Component {
    state = {
        count : 0
    }
    handleIncrement = () => {
        this.setState (
            {
                count : this.state.count + 1
            }
        )
    }
    render () {
        return (
            <div>
                {this.state.count}
                <button onClick={this.handleIncrement}>cli</button>
            </div>
        )
    }
}

export default ClassBasics;
